import React from 'react'

class DogInfo extends React.Component {

  render() {
    const {name, image, isGoodDog} = this.props.dog
    return(
      <>
        <img src={image} alt={name}/>
        <h2>{name}</h2>
        {
          this.props.dog === "" ? null :    
          <button onClick={''}>
            {isGoodDog ? "Good Dog!" : "Bad Dog!"}
          </button>
        }
      </>

    )
  }

}

export default DogInfo
